// n8n Function Item
// Entrada: $json.description_clean (minúsculas, sin espacios dobles)
// Salida: merchant_candidate, merchant_candidate_normalized

function norm(s = "") {
  return s
    .toLowerCase()
    .normalize("NFD").replace(/[\u0300-\u036f]/g, "")
    .replace(/[^a-z0-9\s]/g, " ")
    .replace(/\s+/g, " ")
    .trim();
}

let desc = String($json.description_clean || "").trim();
if (!desc) return [{ ...$json, merchant_candidate: "unknown", merchant_candidate_normalized: "unknown" }];

// ruido común
const STOP_PHRASES = [
  "payment from","payment to","transfer from","transfer to","bank transfer",
  "card payment","pos purchase","card purchase","transaction at","merchant",
  "bill","charge","revolut","sas","sarl","sa","ag","gmbh","spa","srl","ltd",
  "limited","inc","corp","co","store","shop"
];

const NOISE_REGEX = [
  /\b(lu|be|fr|de|nl|es|it|uk|us)\b/g,
  /\bcom\b/g,
  /\bwww\b/g,
  /https?:\/\/\S+/g,
  /[0-9]{2,}/g
];

desc = norm(desc);
for (const rx of NOISE_REGEX) desc = desc.replace(rx, " ");
for (const p of STOP_PHRASES) {
  const rx = new RegExp(`\\b${p.replace(/[.*+?^${}()|[\]\\]/g, "\\$&")}\\b`, "g");
  desc = desc.replace(rx, " ");
}
desc = desc.replace(/\s+/g, " ").trim();

// canónicos rápidos
const CANONICAL = [
  { re: /\bamzn|amazon|prime\s+video|amazon\s+prime\b/, name: "Amazon" },
  { re: /\bapple|itunes|apple\.com\b/, name: "Apple" },
  { re: /\bspotify\b/, name: "Spotify" },
  { re: /\bnetflix\b/, name: "Netflix" },
  { re: /\buber\b/, name: "Uber" },
  { re: /\bbolt\b/, name: "Bolt" },
  { re: /\bcarrefour\b/, name: "Carrefour" },
  { re: /\blidl\b/, name: "Lidl" },
  { re: /\baldi\b/, name: "Aldi" },
  { re: /\bdelhaize\b/, name: "Delhaize" }
];

let canonical = null;
for (const { re, name } of CANONICAL) { if (re.test(desc)) { canonical = name; break; } }

// candidato por primeras palabras relevantes
const CONNECTORS = new Set(["the","and","at","for","from","to","on","in","of"]);
let cand = desc.split(" ").filter(w => w && !CONNECTORS.has(w)).slice(0, 3).join(" ").trim();

const merchant_candidate = canonical || cand || (desc || "unknown");
const merchant_candidate_normalized = norm(merchant_candidate);

return [{
  ...$json,
  merchant_candidate: merchant_candidate_normalized
}];
